  let result = '';
    if (startString == null || startString.length === 0) return result;

    for (const item of set) {
      if (item && item.startsWith(startString)) {
        result += `${item.slice(startString.length)}-`;
      }
    }
  return result.slice(0, result.length - 1);
}
